INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000001, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 0.0, "2030/01/01 14:59:59", 62, "2025/01/31 12:00:00", 190801, 2, 1, 1, 3.414, -416.5, "カリン", 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000002, "ミッションをクリアして、\n報酬をゲットしましょう！", 0.0, "2030/01/01 14:59:59", 62, "2025/01/31 12:00:00", 190801, 2, 2, 1, 3.099, -416.5, "カリン", 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000003, "受け取ることができる\n報酬があるようです\n確認してみてください", 0.0, "2030/01/01 14:59:59", 63, "2025/01/31 12:00:00", 190801, 2, 3, 1, 2.801, -416.5, "カリン", 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000004, "報酬がもらえますよ！\nチェックしてみてください", 0.0, "2030/01/01 14:59:59", 63, "2025/01/31 12:00:00", 190801, 2, 4, 2, 0.0, -416.5, "カリン", 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000005, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 0.0, "2030/01/01 14:59:59", 64, "2025/01/31 12:00:00", 190801, 1, 5, 2, 2.12, -363.0, "カリン", 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000006, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 0.0, "2030/01/01 14:59:59", 64, "2025/01/31 12:00:00", 190801, 2, 6, 1, 1.68, -363.0, "カリン", 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000007, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 0.0, "2030/01/01 14:59:59", 64, "2025/01/31 12:00:00", 190801, 1, 7, 2, 2.33, -363.0, "カリン", 1);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -6.0, "2030/01/01 14:59:59", 61, "2025/01/31 12:00:00", 133701, 7, 101, 3, 5.18, -285.0, "ラビリスタ", 10201);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020102, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -2.0, "2030/01/01 14:59:59", 61, "2025/01/31 12:00:00", 133901, 2, 201, 1, 8.77, -285.0, "クリスティーナ", 10201);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020103, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 0.0, "2030/01/01 14:59:59", 61, "2025/01/31 12:00:00", 133801, 1, 301, 6, 15.5, -285.0, "ネネカ", 10201);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020201, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 0.0, "2030/01/01 14:59:59", 61, "2025/02/28 12:00:00", 134301, 5, 101, 2, 9.061, -285.0, "ランファ", 10202);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 0.0, "2030/01/01 14:59:59", 61, "2025/02/28 12:00:00", 134401, 2, 201, 1, 7.699, -285.0, "チカ", 10202);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020301, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 0.0, "2030/01/01 14:59:59", 61, "2025/03/31 12:00:00", 134601, 2, 101, 1, 8.595, -285.0, "アオイ", 10203);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020302, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 0.0, "2030/01/01 14:59:59", 61, "2025/03/31 12:00:00", 134501, 2, 201, 1, 7.758, -285.0, "クローチェ", 10203);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020401, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 0.0, "2030/01/01 14:59:59", 61, "2025/04/30 12:00:00", 132302, 6, 101, 2, 7.0, -285.0, "ルイズマリー", 10204);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 0.0, "2030/01/01 14:59:59", 61, "2025/04/30 12:00:00", 132402, 2, 201, 1, 7.904, -285.0, "イロハ", 10204);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020403, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 0.0, "2030/01/01 14:59:59", 61, "2025/04/30 12:00:00", 132502, 2, 301, 4, 8.487, -285.0, "ソノ", 10204);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020502, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 0.0, "2030/01/01 14:59:59", 61, "2025/05/31 12:00:00", 134901, 2, 101, 1, 8.763, -285.0, "カノン", 10205);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020503, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 0.0, "2030/01/01 14:59:59", 61, "2025/05/31 12:00:00", 134801, 3, 201, 1, 6.417, -285.0, "ツムギ", 10205);
